function A() {
    //변수, 함수 등을 정의
    const css1={color:"green"}

    return (
        <div>
            <h1>결과입니다.</h1>
            <ul style={css1}><li>리스트1</li><li>리스트2</li><li>리스트2</li></ul>
        </div>
    );
}

export default A;
